import React from 'react'
import Header2 from './Header.js'

const layoutStyle = {
  margin: 20,
  padding: 20,
  border: '1px solid #DDD'
}

export default function Layout2(props) {
  return (
    <div style={layoutStyle}>
      <Header2 />
      {props.children}
    </div>
  )
}
